White Sturgeon eating stickle backs just under the surface on the Fraser River in Chilliwack, British Columbia, Canada. 

Some tend to believe sturgeon only scavenge off the bottom. These fish are efficient hunters of live prey as well. 

Fraser River white sturgeon hunt live salmon, pike-minnows, ooligans, stickle backs, cray fish , eels, and basically anything else they can fit in their mouths. 

Apex predator of the Fraser? I think so. 

